%[text] **1. Laplace Transforms & Transfer functions (25 marks) (Require by Hand - use matlab to check)**
%[text] a) (5 marks) Use the Laplace Transform Lookup Table (Tables 2.1) and Theorems (Table 2.2) to help find Laplace transform of$&dollar&;c(t)=\\frac{55\\,t}{2}+ \\frac{5}{68}-\\frac{5\\,{\\mathrm{e}}^{-6\\,t} \\,{\\left(\\cos \\left(10\\,t\\right)+38\\,\\sin \\left(10\\,t\\right)\\right)}}{68}&dollar&;$
%[text] Justify your answer by stating what lookup table entries and theorems or properties of the Laplace transform are you using. 
%[text] DO THIS PROBLEM IN YOUR EXAM BOOKLET. 
%[text] You can check your work here if you like.
% Your code goes here
clear
% a) (5 marks) Calculate the Laplace transform of c(t)
syms t s
c_t = (55*t)/2 + 5/68 - (5*exp(-6*t)*(cos(10*t) + 38*sin(10*t)))/68 %[output:4f20a50f]
C_s = laplace(c_t, t, s) %[output:09568d90]
%[text] b) (5 marks) If $c(t)$ from part (a) is the output of a transfer function $G\\left(s\\right)${"editStyle":"visual"} in response to the unit ramp input $r\\left(t\\right)=t${"editStyle":"visual"}, what is the transfer function $G\\left(s\\right)${"editStyle":"visual"}?
%[text] ![](text:image:6689)
%[text] DO THIS PROBLEM IN YOUR EXAM BOOKLET. 
%[text] You can check your work here if you like.
% Your code goes here
% b) (5 marks) Calculate the Laplace transform of the unit ramp input r(t) = t
r_t = t; 
R_s = laplace(r_t, t, s) %[output:96d032b4]
% Calculate the transfer function G(s) = C_s / R_s
G_s = C_s / R_s %[output:9e7f3c04]
simplify(G_s) %[output:3a195c59]
%[text] c) (5 marks) For $G(s)=\\frac{s + 3}{(s + 2)^2\\,(s + 4)}$ and input $r(t)=u(t)$, the unit step, what is the system output $c(t)$?
%[text] DO THIS PROBLEM IN YOUR EXAM BOOKLET. 
%[text] You can check your work here if you like.
% Your code goes here
% c) (5 marks) Define the transfer function G(s) for the given system
G_s = (s + 3) / ((s + 2)^2 * (s + 4)) %[output:5a988b03]
% Calculate the output c(t) using the inverse Laplace transform
c_t = ilaplace(G_s * laplace(1, t, s)) % Assuming unit step input %[output:6c67b078]



