%[text] You have to determine the approximate transfer function of the motor to match the data $G(s)=\\frac{K\_m}{s+\\alpha}$. Use matlab command to create a model that fits the data reasonably well and then plot step response of you model against the data to visually compare your fitted model with the data.
%[text] DO THIS IN MATLAB! 
%Your code goes here:
% Solution

load('labDataMidterm26.mat')

% Create an iddata object.
% Input is a Step (1V) vector of the same length as time 't'
u = ones(size(t)); 
Ts = mean(diff(t)); % Calculate sampling time
data = iddata(omega_measured, u, Ts); % omega_measured found from MATLAB data file

% Estimate transfer function with 1 pole and 0 zeros
sys_est = tfest(data, 1, 0); %[output:766a964f]
figure; %[output:59ab0ef3]
% Plot the original measured data
plot(t, omega_measured, 'y-', 'LineWidth', 2,'MarkerSize', 8, 'DisplayName', 'Measured Data');  %[output:59ab0ef3]
hold on; %[output:59ab0ef3]

% Plot the Model Response
% We use 'step' command but define time 't' to match the data range
[y_model, t_model] = step(sys_est, t); 
plot(t_model, y_model, 'r-', 'LineWidth', 2, 'DisplayName', 'Fitted Model (tfest)'); %[output:59ab0ef3]

% Formatting
xlabel('Time $t$ (s)','Interpreter',"latex") %[output:59ab0ef3]
ylabel('$\omega$ (rad/s)',"Interpreter","latex") %[output:59ab0ef3]
title("Model Verification: Measured vs Fitted","Interpreter","latex") %[output:59ab0ef3]
legend('show', 'Location', 'SouthEast'); %[output:59ab0ef3]
grid on; %[output:59ab0ef3]
hold off; %[output:59ab0ef3]
