%[text] c) (5 marks) Find the transfer function $G\_{V\_o}(s)=\\frac{V\_o(s)}{V(s)}$ using nodal analysis in matlab. 
%[text] DO THIS IN MATLAB (no hand calculations required). 
% Your code goes here
% G_Vo_node=   % Assign you answer to this variable
clear
%Your code goes here
% Define the nodal analysis equations for the circuit
syms s V V_A V_O V_C
NodeEqn1=(V_A-V)/1+(V_A-V_O)/(2/s+6*s)+(V_A-V_C)/(5/s+10)==0 %[output:0ed316fa]
NodeEqn2=(V_O-V)/(6*s+2/s)+(V_O-V_C)/(4+6*s)+(V_O-0)/(8)==0 %[output:3aa7de0e]
NodeEqn3=(V_C-V_A)/(10+5/s)+(V_C-V_O)/(4+6*s)+(V_C-0)/(2+1/(4*s)+1)==0 %[output:896ed299]
% Solve the linear system for V_A, V_O, V_C
S = solve([NodeEqn1, NodeEqn2, NodeEqn3], [V_A, V_O, V_C], 'ReturnConditions', false) %[output:1e99d9c7]

% Symbolic transfer function (ratio)
VO_over_V = simplify(S.V_O / V) %[output:8677a34f]
